$().ready(function(){let clubNameDiv=$("#now-club-name");let managingClub=utils.readCache(CONST_VAL.managingClubKey);const a=function(b){clubNameDiv.text(b.name);GLOBAL_VAL.nowClubId=b.id;managingClub=b;utils.publishEvent(CONST_VAL.clubChangedEventKey,b)};if(!managingClub){let clubNodes=$(".club-item");managingClub={id:clubNodes[0].getAttribute("itemId"),name:clubNodes[0].textContent};utils.writeCache(CONST_VAL.managingClubKey,managingClub)}a(managingClub);$("a.dropdown-item.d-flex").click(function(){let clubDiv=$(this).find(".club-item");let clickClub={id:clubDiv.attr("itemId"),name:clubDiv.text()};if(clickClub.id!=managingClub.id){a(clickClub)}});$("#logoutBtn").click(function(){utils.ajax("admin/api/logout",{},"GET",function(){utils.removeCache(CONST_VAL.tokenTime);utils.removeCache(CONST_VAL.tokenKey);utils.removeCache(CONST_VAL.refreshKey);window.location.href="/key3/admin/page/login"},function(b){console.error(b);alert("登出失败，请重试")})});let newClubBtn=$("#newClubBtn");if(newClubBtn[0]){newClubBtn.click(function(){utils.writeCache(CONST_VAL.newClubLockKey,true);window.location.href="/key3/admin/page/club-info?"+CONST_VAL.tokenQueryName+"="+utils.readCache(CONST_VAL.tokenKey)})}});